export const fetchApi = (query) => {
    const queryUrl = `https://svc.metrotransit.org/nextripv2/`+query
    fetch(queryUrl).then(
        response => response.json()
    ).then(data => {
        return data
    }).catch(error => {
        console.error(error);
    })
}

export const fetchApi1 = () => {
    const queryUrl = `https://svc.metrotransit.org/nextripv2/routes`
    return fetch(queryUrl).then(response => response.json())
    .then(data => {
        return data
    })
    .catch(error => {
        console.error(error);
    })
}
